import './App.css';
import axios from 'axios';
import { useState } from "react";
import { useEffect } from "react";
function App() {
  const [users,setUsers]=useState([])

  useEffect(()=>{
    axios.get('http://localhost:4000/ClientHome')
    .then(users => setUsers(users.data))
    .catch(err => console.log(err))
  })
  return (
    <div className="App">
      <h1>selam</h1>
      <h1> {users.map(user =>{
        <p> {user.name}</p>
      })}</h1>
    </div>
  );
}

export default App;
